import React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

interface RegisterProps {
  onBack: () => void;
}

export default function Register({ onBack }: RegisterProps) {
  return (
    <Box
      component="form"
      sx={{
        '& .MuiTextField-root': { m: 1, width: '100%' },
        maxWidth: '400px',
        padding: '20px',
        boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
        borderRadius: '20px',
        backgroundColor: '#fff',
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
      }}
      noValidate
      autoComplete="off"
    >
      <TextField label="Электронный адрес" variant="outlined" fullWidth />
      <TextField label="Логин" variant="outlined" fullWidth />
      <TextField label="Пароль" type="password" fullWidth />
      <TextField label="Подтверждение пароля" type="password" fullWidth />

      <button
        type="submit"
        style={{
          width: '100%',
          padding: '10px',
          marginTop: '15px',
          borderRadius: '30px',
          backgroundColor: 'green',
          color: 'white',
          fontWeight: 'bold',
          border: 'none',
          cursor: 'pointer',
          transition: 'transform 0.3s ease, background-color 0.1s ease',
        }}
        onMouseOver={(e) => (e.currentTarget.style.transform = 'scale(1.05)')}
        onMouseOut={(e) => (e.currentTarget.style.transform = 'scale(1)')}
      >
        Зарегистрироваться
      </button>

      <a
        onClick={onBack}
        style={{
          textDecoration: 'none',
          fontSize: '14px',
          marginTop: '15px',
          textAlign: 'center',
          color: '#007bff',
          cursor: 'pointer',
        }}
      >
        Назад к авторизации
      </a>
    </Box>
  );
}
